function useStats() {
  const [stats, setStats] = useState();
  function fetchApi() {
    useEffect(() => {
      fetch('https://covid19.mathdro.id/api').then(data => data.json());
    }, []);
  }
  fetchApi();
}

export default function IndexPage() {
  return <div>Hello</div>;
}
